description:
Rooftop Lesbians (Joanna Angel, Burning Angel / 2013) 

It's a bird! It's a plane! It's a flock of...LESBIANS! Award-winning director Joanna Angel reaches for the sky in Burning Angel Entertainment's Rooftop Lesbians, Volume 1: Going Up to Go Down, an all-new tribute to sapphic sex shot outdoors against dazzling downtown skylines. Cover beauties Nikki Hearts and Veruca James are ably supported by Asphyxia Noir, Azrael Arden, Kleio, Lily Lane, Memphis Leigh, Roggie, Sierra Cure and Syren in scene after scene of high-rise seduction.

Veruca James, Syren, Sierra Cure, Kleio, Nikki Hearts, Asphyxia, Azrael Arden, Lily Lane, Roggie

Girl-Girl, Public Sex

